snippet.textDisplay:
@cokestudioind Being fan of CokeStudio from years...Now it's happening in India makes me more happier & thanks for that

Now talking about new release "TAQDEER" 

@prabhdeepmusic You with that intro "Aa vekh kinna sohna ve darakht..Chaa vich behjaa bitale thoda waqt"...
Listener felt Like a tired Musafir to sit under Darakht in the calmness of some deserts of Sindh-Jaisalmer
& then Sarangi plays in & right there Sindhi folk by Sakur Khan 
@Rashmeetmusic powerful vocals 🔥
And outro w lap guitar @VarunDhabe 🥵
Thanks @DonnBhat @ankurtewari  4dis

